(3, 4, 'Terms and Conditions', '<h4>What is Lorem Ipsum?</h4><p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p><h4>Where does it come from?</h4><p>Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.</p><p>											</p>', 'en', '2021-10-06 07:02:54', '2022-06-17 09:21:18'),
(5, 3, 'Warranty Policy', '<h1 style=\"text-align: center; \"><b>What\'s a Warranty Disclaimer?</b></h1><div style=\"\">A Warranty Disclaimer is where you let your customers know the specific and exact terms of your warranty, such as:</div><ul><li>What parts or components of a product are covered by the warranty and what parts/components are not covered</li><li>How long the warranty period lasts for (how long can customers get coverage)</li><li>What you will do to correct any issues with a product that fall under the warranty\'s coverage</li><li>How a customer can get service under the warranty</li><li>Whether any state laws affect certain provisions of your Warranty (in the case of US warranties)</li></ul><h5 style=\"\"><b>What to include in a Warranty?</b></h5><div style=\"\">What to include in your warranty really depends on your business and what kind of products you sell.</div><div style=\"\">Here are some of the most common and useful sections that are standard to most warranties. They\'re a good place to start when putting together your own warranty terms.</div><div style=\"\"><br></div><h5 style=\"\"><b>Section #1: What does this warranty cover?</b></h5><div style=\"\">The first section of your warranty should include what it covers. For example, note that the warranty:</div><ul><li>Covers any defects in materials used to manufacture your product</li><li>Covers any defects in workmanship under normal use</li><li>Covers any broken components under normal use</li></ul><h5 style=\"\"><b>Section #2: What will you do to correct problems?</b></h5><div style=\"\">The second section of your warranty should include what you, as a company, will do to correct the problems faced by a customer for products that are still under warranty.</div><div style=\"\">Depending on your business model and what youâ€™d like to include, this section can have any of the following or some different remedy:</div><ul><li>The company will repair the product, at no cost, if the product is still under warranty</li><li>The company will repair any broken parts of a product using new or replacement parts</li><li>The product will be exchanged with a new product</li><li>The price of product will be refunded</li></ul><h5 style=\"\"><b>Section #3: How long does the coverage last?</b></h5><ul><li>The third section of your warranty needs to mention how long the warranty coverage lasts. This will be how many days/years a customer has protection under the warranty.</li><li>This section depends on the goods youâ€™re selling and what coverage you want to offer. You may have one flat warranty period (everything gets a 2-year warranty). </li><li>Or, you may have multiple categories of products that need different periods of coverage. If you have multiple categories, mention the list of products and what warranty period exists for each.</li></ul><h5 style=\"\"><b>Section #4: What does this warranty not cover?</b></h5><div style=\"\">The fourth section of your warranty can include conditions which are not covered by your company, such as:</div><ul><li>Damage of a product resulting from negligence</li><li>Damage of a product resulting from unauthorised modification of the product</li><li>Damage caused by natural disaster</li><li>Theft or loss of the product</li><li>etc.</li></ul><h5><b>Section #5: What do customers need to do to get repairs/service under the warranty?</b></h5><p>The last section of your warranty should include information about how a customer can contact you to get service for the products and what conditions must be met during the process. This can include things like:</p><ul><li>If the product must be in returned in its original packaging, or if the customer can send it in any package</li><li>If a Return Merchant Authorization (RMA) is required</li><li>If any documents or accessories that shipped with the product must be included in the package</li><li>How to contact you: by email, by phone or by mail address</li><li>Any nominal fees you charge for shipping, handling, etc.</li></ul><h5><b>Section #6: Applicable state laws</b></h5><ul><li>Depending on your country, states laws might affect what you write in the warranty.</li><li>US businesses include a Consumer Protection section in their warranty disclaimers:</li><li>Consumer Protection</li><li>Some states do not allow the exclusion or limitation of incidental or consequential damages or allow limitations on how long an implied warranty lasts, so the above limitations or exclusions may not apply to you. </li><li>This warranty gives you specific legal rights, and you may also have other rights that vary by state to state.</li></ul>', 'en', '2021-11-03 07:27:53', '2021-11-07 02:51:21'),
(6, 5, 'Privacy Policy', '<ul><li><b style=\"background-color: rgb(255, 255, 255);\">What is a privacy policy?\r\n											</b><div>A privacy policy is a document that states what personal data you collect from your users, why, and how you keep it private.\r\n</div><div>The purpose of the privacy policy is to inform your users about how their data is being handled.\r\n</div><div>Hence, the privacy policy should be accessible for your users and kept in plain and readable language.\r\n</div><div>Most countries have privacy laws requiring that websites collecting personal data have a proper privacy policy in place.\r\n</div><div>Failure to comply can result in heavy fines and even prosecution. Are you based in the EU or providing services to EU citizens, you must have a GDPR compliant privacy policy on your domain.\r\n</div><div>We will get into this in more detail below.\r\n</div><ul><li><b>What is personal data?\r\n</b></li></ul><div>Personal data is information that can identify an individual, either directly or when combined with other data.\r\n</div><div>Names, e-mails, addresses, localization, IP addresses, photos, and account information all are directly identifying data.\r\n</div><div>Health information, income, religion, and cultural profiles, and the like is also personal data.\r\n</div><div>Furthermore, and crucial in the present context, data on user behavior is also personal. Cookies can track and register individual usersâ€™ browsing activities, like what articles they scroll past and which ones they choose to click on.\r\n</div><div><br></div><div><br></div><div>\r\n</div><div>\r\n</div><div>\r\n</div><div>\r\n</div><div>\r\n</div><div>\r\n</div><div>\r\n</div><div>\r\n</div><div>\r\n</div><div>\r\n</div></li></ul>', 'en', '2021-11-18 15:51:43', '2021-11-18 15:51:43'),
(7, 2, 'Return Policy', '<b>What are Return and Refund Policies?\r\n</b><div>In essence, a Return &amp; Refund Policy is a policy that dictates under what conditions customers can return products they\'ve purchased from your eCommerce store and whether you\'ll reimburse them or not. It will also let your customers know the time frame within which your company can accept returns.</div>', 'en', '2021-11-18 15:58:46', '2021-11-18 15:58:46');
