(309, 6, 'Wet n Wild Photo Focus Matte Face Primer 25ml', 59, '2366', '2366', '', '<p>Remember when you were a kid, watching fairy tales, wishing you had a magic potion to transform yourself instantly into a glamorous princess? Well, we’re here to make your dreams come true! This miraculous primer can be used all over your face to minimize the appearance of pores, fill in fine lines and wrinkles, even out skin tone, prevent your foundation from caking, and brighten your complexion for ultra-vibrant color that lasts all day. Magic! How does it do this?</p><p><img src=\"http://34.142.253.82/backend/public//uploads/all/B0lBdfoMPg5jnDZ4v3lqVVBfLUsYUup717DR9Jwj.jpg\" style=\"width: 365.552px;\"><br></p><p> Because we basically put diamonds in a bottle! No, really, we did. The key ingredient in this miracle primer is white sapphire, formulated into a smooth, silky cream that glides on effortlessly, leaving behind a crystal complexion. Just think of us as your fairy godmother!</p>', 2000.00, 2200.00, 0.00, 'flat', 1654819200, 1659311940, 21, 0, 0, 0, 'pc', 1, 0, 1, 1, 0, NULL, 0.00, 0.00, 0.00, 0.00, 'Wet n Wild Photo Focus Matte Face Primer 25ml', 'Remember when you were a kid, watching fairy tales, wishing you had a magic potion to transform yourself instantly into a glamorous princess? Well, we’re here to make your dreams come true! This miraculous primer can be used all over your face to minimize the appearance of pores, fill in fine lines and wrinkles, even out skin tone, prevent your foundation from caking, and brighten your complexion for ultra-vibrant color that lasts all day. Magic! How does it do this? Because we basically put diamonds in a bottle! No, really, we did. The key ingredient in this miracle primer is white sapphire, formulated into a smooth, silky cream that glides on effortlessly, leaving behind a crystal complexion. Just think of us as your fairy godmother!', 2366, 'wet-n-wild-photo-focus-matte-face-primer-25ml-euox3', 0.00, 20, '[{\"title\":\"Skin Type\",\"detail\":\"All Types of Skin\"},{\"title\":\"Solution Type\",\"detail\":\"Unassigned\"},{\"title\":\"Brand Name\",\"detail\":\"Wet n Wild\"},{\"title\":\"Manufacturer\",\"detail\":\"Wet n Wild\"},{\"title\":\"Distributed By\",\"detail\":\"Lira Import\"}]', '2022-05-23 14:36:33', '2022-07-03 00:05:04', NULL),
(310, 6, 'Absolute New York HD Flawless Foundation - Natural - AHDF01 - 28ml', 58, '2367', '2367', '', '<p>\r\n</p><p>Ingredients: Aqua, Cyclopentasiloxane, Cyclohexasiloxane, Cetyl Ethylhexanoate, Disteardimonium Hectorite, Propylene Carbonate, Beeswax, Cetyl PEG/PPG-10/1 Dimethicone, Glyceryl Laurate, Stearyl Dimethicone, Octadecene, Polyglyceryl-4 Oleate, Phenoxyethanol, Ethylhexylglycerin, Caprylyl Glycol, Tocopheryl Acetate, Propylene Glycol, Centaurea Cyanus Flower Extract<br></p><p>A double-duty formula that contains emollients and antioxidants will repair a dry and flaky skin texture, while providing even, long-lasting coverage to improve the current appearance of your weather-worn complexion.\r\n</p><p>This mineral foundation provides medium-to-full coverage that also hydrates skin without adding extra shine. Its 60% encapsulated water formula makes it a moisture-rich option for intensely parched skin.\r\n</p><p>The HD Flawless Foundation by Absolute New York boasts a lightweight, water -based formula that melts over skin to instantly hide imperfections, even out skin tone and eliminate excess shine - for exceptionally smooth, natural, second-skin coverage that lasts all day.\r\n</p><p>Features\r\n</p><p>Long-lasting\r\n</p><p>Light weight\r\n</p><p>Easy to blend\r\n</p><p>Moisture and hydrate skin\r\n</p><p>Waterproof\r\n</p><p>Control excess oil\r\n</p><p>Absolute New York HD Flawless Foundation\r\n</p><p>Absolute New York HD Flawless Foundation\r\n</p><p>This HD foundation provides light to medium coverage that allows for a natural look. A perfect hydrating formula fit with the skin texture & color without being greasy. It gives a matte finishes and perfect for normal to dry skin. Ultra absorbed smooth formula helps to control excess oily sheen and gives a natural flawless makeup and a youthful-looking glow.\r\n</p><p>This HD foundation is a long lasting liquid product to create an even skin, uniform color to the complexion, cover flaws and don’t change the natural skin tone. It also function as a moisturizer, sunscreen, astringent or base layer for more perfect skin.\r\n</p><p>The product is tested under super hi-def cameras to find skin problems are less detectable on camera. It can help to even skin tone and texture, even with minimal product.</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 800.00, 800.00, 10.00, 'percent', 1654819200, 1659311940, 25, 0, 0, 0, 'pc', 1, 0, 1, 0, 0, NULL, 0.00, 0.00, 0.00, 0.00, 'Absolute New York HD Flawless Foundation - Natural - AHDF01 - 28ml', 'Ingredients: Aqua, Cyclopentasiloxane, Cyclohexasiloxane, Cetyl Ethylhexanoate, Disteardimonium Hectorite, Propylene Carbonate, Beeswax, Cetyl PEG/PPG-10/1 Dimethicone, Glyceryl Laurate, Stearyl Dimethicone, Octadecene, Polyglyceryl-4 Oleate, Phenoxyethanol, Ethylhexylglycerin, Caprylyl Glycol, Tocopheryl Acetate, Propylene Glycol, Centaurea Cyanus Flower ExtractA double-duty formula that contains emollients and antioxidants will repair a dry and flaky skin texture, while providing even, long-lasting coverage to improve the current appearance of your weather-worn complexion.\r\nThis mineral foundation provides medium-to-full coverage that also hydrates skin without adding extra shine. Its 60% encapsulated water formula makes it a moisture-rich option for intensely parched skin.\r\nThe HD Flawless Foundation by Absolute New York boasts a lightweight, water -based formula that melts over skin to instantly hide imperfections, even out skin tone and eliminate excess shine - for exceptionally smooth, natural, second-skin coverage that lasts all day.\r\nFeatures\r\nLong-lasting\r\nLight weight\r\nEasy to blend\r\nMoisture and hydrate skin\r\nWaterproof\r\nControl excess oil\r\nAbsolute New York HD Flawless Foundation\r\nAbsolute New York HD Flawless Foundation\r\nThis HD foundation provides light to medium coverage that allows for a natural look. A perfect hydrating formula fit with the skin texture &amp; color without being greasy. It gives a matte finishes and perfect for normal to dry skin. Ultra absorbed smooth formula helps to control excess oily sheen and gives a natural flawless makeup and a youthful-looking glow.\r\nThis HD foundation is a long lasting liquid product to create an even skin, uniform color to the complexion, cover flaws and don’t change the natural skin tone. It also function as a moisturizer, sunscreen, astringent or base layer for more perfect skin.\r\nThe product is tested under super hi-def cameras to find skin problems are less detectable on camera. It can help to even skin tone and texture, even with minimal product.', 2367, 'absolute-new-york-hd-flawless-foundation-natural-ahdf01-28ml-j3bc6', 0.00, 32, '[{\"title\":\"Skin Type\",\"detail\":\"All Types of Skin\"},{\"title\":\"Solution Type\",\"detail\":\"Unassigned\"},{\"title\":\"Manufacturer\",\"detail\":\"Absolute New York\"},{\"title\":\"Ccountry of Manufacture\",\"detail\":\"China\"},{\"title\":\"Distributed By\",\"detail\":\"RT World Ltd\"}]', '2022-05-23 15:01:15', '2022-07-03 00:05:03', NULL),
