(313, 6, 'Absolute New York HD Flawless Foundation - Natural - AHDF01 - 28ml', 55, '2367', '2367', '', '<p>\r\n</p><p>Ingredients: Aqua, Cyclopentasiloxane, Cyclohexasiloxane, Cetyl Ethylhexanoate, Disteardimonium Hectorite, Propylene Carbonate, Beeswax, Cetyl PEG/PPG-10/1 Dimethicone, Glyceryl Laurate, Stearyl Dimethicone, Octadecene, Polyglyceryl-4 Oleate, Phenoxyethanol, Ethylhexylglycerin, Caprylyl Glycol, Tocopheryl Acetate, Propylene Glycol, Centaurea Cyanus Flower Extract<br></p><p>A double-duty formula that contains emollients and antioxidants will repair a dry and flaky skin texture, while providing even, long-lasting coverage to improve the current appearance of your weather-worn complexion.\r\n</p><p>This mineral foundation provides medium-to-full coverage that also hydrates skin without adding extra shine. Its 60% encapsulated water formula makes it a moisture-rich option for intensely parched skin.\r\n</p><p>The HD Flawless Foundation by Absolute New York boasts a lightweight, water -based formula that melts over skin to instantly hide imperfections, even out skin tone and eliminate excess shine - for exceptionally smooth, natural, second-skin coverage that lasts all day.\r\n</p><p>Features\r\n</p><p>Long-lasting\r\n</p><p>Light weight\r\n</p><p>Easy to blend\r\n</p><p>Moisture and hydrate skin\r\n</p><p>Waterproof\r\n</p><p>Control excess oil\r\n</p><p>Absolute New York HD Flawless Foundation\r\n</p><p>Absolute New York HD Flawless Foundation\r\n</p><p>This HD foundation provides light to medium coverage that allows for a natural look. A perfect hydrating formula fit with the skin texture & color without being greasy. It gives a matte finishes and perfect for normal to dry skin. Ultra absorbed smooth formula helps to control excess oily sheen and gives a natural flawless makeup and a youthful-looking glow.\r\n</p><p>This HD foundation is a long lasting liquid product to create an even skin, uniform color to the complexion, cover flaws and don’t change 