(327, 6, 'Prime Magic Camera Ready Anti-Redness Primer', 53, '2456', '2456', 'Prime Magic Camera Ready Anti-Redness Primer', '<p>Prime Magic is a range of primers that help create a smooth and perfect base before applying makeup. The four different products within the collection target different areas of the face.\r\n</p><p>The green formula is an anti-redness primer, for skin prone to redness, which helps create a more even skin tone and corrects color.</p><ul><li>Helps to create a smooth and perfect base before applying makeup\r\n</li><li>Evens out imperfections and creates a long-lasting base\r\n</li><li>Transparent in color and is very smooth upon application due to the silicone\r\n</li><li>Gives long-lasting and effective makeup base\r\n</li><li>Blurs Imperfections & Fine Lines\r\n</li><li>Prime Magic is vegan-friendly\r\n</li><li>Makes makeup easier Smooth skin reduces defects, replenishes wrinkles\r\n</li><li>Helps disguise pores to makeup to last\r\n</li><li>Suitable for normal skin types</li></ul>', 550.00, 550.00, 130.00, 'flat', 1655769600, 1659311940, 100, 0, 0, 0, '30 ml', 1, 0, 1, 0, 0, NULL, 0.00, 0.00, 0.00, 0.00, 'Prime Magic Camera Ready Anti-Redness Primer', 'Prime Magic is a range of primers that help create a smooth and perfect base before applying makeup. The four different products within the collection target different areas of the face.\r\nThe green formula is an anti-redness primer, for skin prone to redness, which helps create a more even skin tone and corrects color.Helps to create a smooth and perfect base before applying makeup\r\nEvens out imperfections and creates a long-lasting base\r\nTransparent in color and is very smooth upon application due to the silicone\r\nGives long-lasting and effective makeup base\r\nBlurs Imperfections &amp; Fine Lines\r\nPrime Magic is vegan-friendly\r\nMakes makeup easier Smooth skin reduces defects, replenishes wrinkles\r\nHelps disguise pores to makeup to last\r\nSuitable for normal skin types', 2456,