(1, 0, 'XTAR Moto 4T 10W30 1L', NULL, '<p>Multi-grade synthetic lubricant formulated with Premium EfficientLUB® technology with fuel economy properties. Thanks to its balanced formulation, it provides an optimal balance between appropriate clutch friction and extra fuel economy compared with other oils on the market. On the road in all types of driving and in urban traffic with frequent starts and stops.\r\n</p><p><br></p><p>\r\n</p>', 'en', '2022-07-25 00:25:13', '2022-07-25 00:25:13', NULL),
(2, 2, 'XTAR Moto 4T 10W30 2L', NULL, '<p>Multi-grade synthetic lubricant formulated with Premium EfficientLUB® technology with fuel economy properties. Thanks to its balanced formulation, it provides an optimal balance between appropriate clutch friction and extra fuel economy compared with other oils on the market. On the road in all types of driving and in urban traffic with frequent starts and stops.</p><p>\r\n</p>', 'en', '2022-07-25 00:47:41', '2022-07-25 00:47:41', NULL),
