(157, 'home_about_us', '<h1><b><font color=\"#9c9c94\">THE SHOP | AN ONLINE SHOPPING PLATFORM WITH GREAT DEALS\r\n													</font></b></h1><div>\r\n</div><div><font color=\"#9c9c94\">THE SHOP Bangladesh is a leading online shopping site based in Bangladesh that brings you great deals, with platforms existing across Asia including Singapore, Thailand, Indonesia, Vietnam, Philippines, and Taiwan. We offer unbeatable deals featuring an endless range of products priced at affordable rates. Whatâ€™s even better? We enhance your experience with THE SHOP Guarantee, which means your payment is held in our system and only released to the seller after you have received your purchase in good condition! All because we value you as our customer. What are you waiting for? Come aboard and start browsing!</font></div><div><font color=\"#9c9c94\"><br></font></div><div>\r\n</div><h5><font color=\"#9c9c94\">THE SHOP -- QUALITY PRODUCTS, LOW PRICES\r\n</font></h5><div><font color=\"#9c9c94\">THE SHOP strives to provide you with a great online shopping experience and we know a great experience often includes affordable prices. Thatâ€™s why you should check out THE SHOP Bangladesh site/appâ€™s daily online Shocking Sale, where we offer you different products at a discounted price, ensuring you get a bang for your buck. We even offer free shipping vouchers on products up to 5kg in West Bangladesh, and 1kg in East Bangladesh! For those who are brand-loyal, head over to THE SHOP Mall for authentic products at superb prices.</font></div><div><font color=\"#9c9c94\"><br></font></div><div>\r\n</div><div><font color=\"#9c9c94\">Want to look your best without burning a hole in your wallet? Check out Style by THE SHOP for our top picks in fashion. Want to get the best prices for day-to-day items? Browse through our Lowest Price Guaranteed page. If you find the same Lowest Price Guaranteed item being sold at a lower price by a competitor, we will reward you with 120% of the price difference in THE SHOP Coins! You can also find official online shops for some of Bangladeshâ€™s biggest brands here, such as Nestle, Unilever, Mydin, Tefal, Calvin Klein, and more right here on our platform.</font></div><div><font color=\"#9c9c94\"><br></font></div><div>\r\n</div><div><font color=\"#9c9c94\">Want the best deals for food and household items, and enjoy online grocery express delivery to your doorstep? Be sure to visit our THE SHOP Mart! Another quintessential aspect of every purchase is the reliability of your product. Most products listed on THE SHOP have reviews by previous buyers, allowing you to make informed purchases. Now you can be at ease when shopping with THE SHOP!</font></div><h3><font color=\"#9c9c94\"><br></font><h5><font color=\"#9c9c94\">SHOP FOR VARIETY WITH THE SHOP\r\n</font></h5></h3><div>\r\n</div><div><font color=\"#9c9c94\">Everyone loves online shopping for the convenience and the low prices are a bonus! THE SHOP strives to help you get a bang for your buck with multiple sales and promotions happening at any one time. Make sure your wallet is ready for our big sales campaigns, such as 7.7 Orange Madness, 9.9 Super Shopping Day, 10.10 Brands Festival, 11.11 Big Sale, and 12.12 Birthday Sale. We also have massive sales and offer great savings to you during major festivals like Chinese New Year and Raya! At the same time, check in often because we also have smaller sale periods which are category-specific, such as our Baby Fair and Black Friday sales.</font></div><div><font color=\"#9c9c94\"><br></font></div><div>\r\n</div><div><font color=\"#9c9c94\">Letâ€™s not forget about the frequently occurring Super Brand Day! On these days, specific brands offer amazing deals for their top-selling items, so be sure to keep an eye out to see if your favourite brand is featuring. Of course, there are always different kinds of smaller promotions happening every day, so you really will benefit if you constantly check your THE SHOP app or the website to ensure you are not missing any mind-blowing offers! Want even more savings? Then apply for the Maybank THE SHOP Credit Card so you can earn THE SHOP coins when spending on THE SHOP purchases, dining, entertainment, and contactless transactions. More THE SHOP coins mean more discounts during your shopping sprees on our platform!</font></div><div>\r\n</div><div>\r\n</div><div>\r\n</div><div>\r\n</div><div>\r\n</div><div>\r\n</div><div>\r\n</div>', '2021-09-29 05:41:11', '2021-11-09 18:50:54', NULL),
